function mkdom(txt, type){
    var span = document.createElement("span")
    if( type == "native" || type == "bj"){
        span.innerHTML = "<a href='/doc/"+txt+"'>" + txt + "</a>"
    }else {
        span.innerText = txt
    }
    span.setAttribute("class", type)
    return span

}

function tokenize(txt, type){
    var i = 0;
    var match;
    var res = []
    var dom;
    var span = document.createElement(type)
    span.setAttribute("class", "jassed")
    while(txt){
        for(i = 0; i != tokens.length; i++){
            if(match = txt.match(tokens[i][0])){
                dom = mkdom(match[0], tokens[i][1])
                span.appendChild(dom)
                txt = txt.slice(match[0].length)
                break
            }
        }
    }
    return span
}

function hl(){
    var i
    var pres = Array.from(document.querySelectorAll("pre"))
    for(i = 0; i != pres.length; i++){
        pres[i].replaceWith(tokenize(pres[i].innerText, "pre"))
    }

    pres = Array.from(document.querySelectorAll("code"))
    for(i = 0; i != pres.length; i++){
        pres[i].replaceWith(tokenize(pres[i].innerText, "code"))

    }
}


